import axios from "axios";
import React, { useEffect, useState } from "react";
import starwars from "../../image/starwars.png";
import "./Exercise2.scss";

const Exercise2 = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    try {
      (async function () {
        let res = await axios.get(
          "https://run.mocky.io/v3/d03e0886-f5c8-4961-902d-51bfe8059a33"
        );
        let data = res.data ? res.data : [];
        setData(data);

        console.log("data:", data);
      })();
    } catch (error) {
      console.log(error);
    }
  }, []);
  return (
    <div className="container">
      {/* <h1>Hello cac ban</h1> */}
      <div className="header-scores">
        <span>0</span>
        <span>1</span>
      </div>
      <div className="body">
        <div className="body-item">
          <div className="body-title">Snowspeeder</div>
          <div className="body-image">
            <img src={starwars} alt="" />
          </div>
          <div className="body-list">
            <div className="item">
              <span>Max Speed</span>
              <span>650</span>
            </div>
            <div className="item">
              {" "}
              <span>Credit</span>
              <span>unknown</span>
            </div>
            <div className="item">
              {" "}
              <span>Passengers</span>
              <span>0</span>
            </div>
            <div className="item">
              {" "}
              <span>Film Appearances</span>
              <span>1</span>
            </div>
          </div>
        </div>
        <div className="body-item">
          <div className="body-title">Storm TV Twin-Pod cloud car</div>
          <div className="body-image">
            <img src={starwars} alt="" />
          </div>
          <div className="body-list">
            <div className="item">
              <span>Max Speed</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Credit</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Passengers</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Film Appearances</span>
              <span>?</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Exercise2;
